import ScrollHandlerMixin from "@/mixins/scrollHandler";

export default {
  install(Vue) {
    Vue.mixin(ScrollHandlerMixin);

    Vue.prototype.$log = function (methodOptions) {
      console.log("simplePlugin works");
    };
  },
};
